import React from 'react';
import '.././style/App.css';
import Sample from '.././feed/sample.json';
import{Row, Col, Card} from 'react-bootstrap';

class Series extends React.Component {

  constructor(props){
    super(props);
  }

  render(){
    return(
      <div>
        <div class="titre">
          <p>
            Popular Series
          </p>
        </div>
        <Row>
          {this.props.feed.map((serie, index) => (
            <Col key={index} sm={4} md={4} lg={3}>
              <Card style={{ width: '18rem'}}>
                <Card.Img variant="top" src={""+serie.Poster_Art} />
                <Card.Body>
                    <Card.Title> {serie.title} </Card.Title>
                </Card.Body>
              </Card>
            </Col>
          ))

          }

        </Row>

      </div>
    );
  }
}

export default Series;
